import React from "react";
import "./styles.css";

const EmailComponent = (setEmail) => {
  console.log(typeof setEmail);
  return (
    <div>
      <input
        className="Layout"
        type="text"
        placeholder="Enter an email"
        onChange={(e) => setEmail(e.target.value)}
      />
    </div>
  );
};

export default EmailComponent;
